$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_c1a8289933125def4d4e59dd4500dee3'] = 'Předautorizované platby';
$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_ce33499e4723be8bb943ec32a16930d3'] = 'Předautorizované platby je druh plateb, který blokuje prostředky na bankovním účtu zákazníka. V okamžiku dokončení platby na platební bráně nejsou finanční prostředky převedeny na účet společnosti GoPay, ale vytvoří blokaci v bance klienta. Blokované prostředky mohou být následně převedeny k obchodníkovi nebo obchodník může blokaci zrušit. Všechny operace s předem schválenými platbami lze provádět po dobu 4 dnů od stanovení platby. Pouze platební karty podporují platbu předem.';
$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_b98f7375f44ee0c2d54320926a92788f'] = 'Opakované platby';
$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_b7bcbd34fcef65d8c0cb0af9cb973692'] = 'Opakovaná platba je funkce, která umožňuje pravidelné přijímání plateb od zákazníka. Zákazník je v okamžiku vytvoření platby informován na platební bráně o svých parametrech (částka, frekvence plateb atd.). Po úspěšné inicializaci se platba automaticky vyplácí ve stanoveném období nebo na vyžádání. Zákazník je informován e-mailem o každé dokončené platbě. Obchodník je informován prostřednictvím oznámení o změně platby. Pouze platební karty podporují opakující se platby.';
